/**
 * Aspect ratio of a UIImage
 * Reference: https://docs.microsoft.com/en-us/dotnet/api/xamarin.forms.aspect
 */
export class Aspect {
    /** @returns {Aspect} */ static get ASPECT_FILL(): Aspect;
    /** @returns {Aspect} */ static get ASPECT_FIT(): Aspect;
    /** @returns {Aspect} */ static get FILL(): Aspect;
}
